import React from 'react'


const Review = () => {
    return (
        <div>
            <div>  <p className='font-bold'>Requset Information</p>
                <p className='text-[13px]'>Provide details about the RFQ</p>
            </div>
            <img
                src="../images/date.png"
                alt="Example"
                style={{ width: "25px", height: "auto" }}
            />
        </div>
    )
}

export default Review
